"""Next we are going to create a function to help us analyze the past performance of a list of ETFs."""

def get_performance(etf_tickers, start_date, end_date):
  percent_returns = []
  best_ticker = ""
  best_return = 0
  amount_invested = 1000
  allocated_return = 0

  for ticker in etf_tickers:
      stock = yf.Ticker(ticker)
      asset_type = stock.info['quoteType']
      name = stock.info['shortName']
      info = stock.history(start = start_date, end = end_date)

      start_price = info["Open"][0]
      end_price = info["Close"][-1]
      dollar_increase = end_price - start_price
      basic_return_pct = (dollar_increase / start_price) * 100
      etf_return = round(amount_invested + (amount_invested * (basic_return_pct / 100)), 5)
      allocated_return += etf_return

      print(f"{ticker}: {name} security is an {asset_type}. ")
      print(f"{start_date} price: \t${start_price:,.2f}\n{end_date} price:\t${end_price:,.2f}")
      print(f"The {asset_type} increased ${dollar_increase:,.2f}, with a {basic_return_pct:,.3f}% return from {start_date} to {end_date}.\n")
      
      if basic_return_pct > best_return:
          best_return = basic_return_pct
          best_ticker = ticker
          best_name = name

  dollar_return = round(amount_invested + (amount_invested*(best_return/100)), 5)

  print(f'''The best performing security is {best_ticker} {best_name} with a {best_return:,.3f}% return over that period.
${amount_invested:,.2f} invested from {start_date} to {end_date} would return ${dollar_return:,.2f} today.\n
        ''')

  print(f'''A total of ${(amount_invested*10):,.2f} with ${amount_invested:,.2f}
invested in each of the {len(etf_tickers)} ETFs will result in a gain of ${allocated_return:,.2f}.
A {((allocated_return)/(amount_invested)):,.3f}% return on investment.''')

