# Again, we should make some functions to make our lives easier later on.
def get_today(symbol):
  etf = yf.Ticker(symbol)
  print(f"{etf.info['shortName']} ({symbol})")
  print('---------------------------------')
  prices = etf.history(start="2020-03-16", end="2020-03-17")
  low = prices.loc["2020-03-16", 'Low']
  high = prices.loc["2020-03-16", 'High']
  buy = round(((high + low) / 2), 2)
  print(f"Today's price for {symbol} is a high of ${high:,.2f} and low of ${low:,.2f}.")
  print(f"We managed to buy {symbol} for ${buy:,.2f} per share.")
  return buy

def get_allocation(price, percentage):
  shares = int((12000 * (percentage / 100)) / price)
  amt = round((shares * price), 2)
  return shares, price, amt

# Setting up a portfolio for later analysis
portfolio = dict()

clean_energy_symbol = 'TAN'

clean_energy_price = get_today(clean_energy_symbol)

clean_energy = tuple()
clean_energy = get_allocation(clean_energy_price, 5)

portfolio[clean_energy_symbol] = clean_energy

print()
